import {useEffect, useState} from 'react';
import {useParams} from 'react-router-dom';
import {useSelector, useDispatch} from 'react-redux';
import CardList from '../../components/card-list/card-list.component';
import {selectNFTs} from '../../redux/nft/nft.selectors';
import {fetchNFTStart} from '../../redux/nft/nft.actions';

const CollectionPage = () => {
	const dispatch = useDispatch();
	const nfts = useSelector(selectNFTs);
	useEffect(() => {
		dispatch(fetchNFTStart());
	}, [dispatch]);
	console.log(nfts);

	const [searchField, setSearchField] = useState('');
	const [filteredNFTs, setFilterNFTs] = useState(nfts);

	useEffect(() => {
		fetch('http://localhost:3002/api/getNFTs')
			.then((response) => response.json())
			.then((nfts) => setNFTs(nfts));
	}, []);

	useEffect(() => {
		const newFilteredNFTs = nfts.filter((nft) => {
			return nft.collection_name.includes(searchField);
		});

		setFilterNFTs(newFilteredNFTs);
	}, [nfts, searchField]);


	const collectionName = useParams();
	return (
		<div/>
	);
};

export default CollectionPage;
